      ', '                version to the 54A(B)8 force-field version involve a

      ', '                reparametrization of

      ', '                - the charged amino-acid sidechains of peptides

      ', '                - the charged peptide termini

      ', '                - the lipid DPPC

      ', '                - the uronate residues

      ', 'Remark        : This file only differs from the 54A7 file in the VdW parameters
      of atom types

      ', '                NL and CH3p, and in the VdW selection matrix for OM-CH3p
      (I-I in 54A8 vs III-I

      ', '                in 54A7; affects DPPC, where the change of Poger, made from
