      ', '                "reverted" because CH3p is now bigger)

      ', 'Remark        : There is no B force-field version for this set (use 54B7
      instead)

      ', 'Remark        : Versions beyond 54A(B)7 [including 54C(D)7, 53A(B)6@OXY,
      56A(B)6@CARBO]

